import React,{ useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useSelector, useDispatch } from 'react-redux';
import { detailsPuppy } from '../actions/puppyActions';
import {Nav, Col, Row, Tabs, Tab} from 'react-bootstrap';
import '../App.css';
const PuppyPage = (props) => {

    const puppyDetails = useSelector(state => state.puppyDetails);
    const { puppy, loading, error } = puppyDetails;
    const dispatch = useDispatch();

  useEffect(() => {
    dispatch(detailsPuppy(props.match.params.id));
      return () => {
          //
      }
  }, []);
  const handleAddtoDeposit = () => {
      props.history.push("/deposit/" + props.match.params.id)
  }

    return <div className="PuppyPage">

      <div className="Page">

      <div className="PageBody">
      <Link to="/">
    <div className="back-to-result">
      Back to result
    </div>
    </Link>



    <div className="puppyDetailsStyle">

    {loading ? <div>Loading...</div> :
      error ? <div>{error} </div> :
        (

    <div className="details">
     <h1> {puppy.name} </h1>



    <div className="Intro">{puppy.name} is a wonderful {puppy.discription}.
    <div >
    <img src={puppy.image} alt="puppy" className="details-image"></img>
    </div>
    <Tab.Container id="left-tabs-example" defaultActiveKey="first">
  <Row>

      <Nav variant="pills" className="flex-row">

        <Nav.Item>
          <Nav.Link eventKey="first">Photos of {puppy.name}</Nav.Link>
        </Nav.Item>

        <Nav.Item>
          <Nav.Link eventKey="second">Video of {puppy.name}</Nav.Link>
        </Nav.Item>
      </Nav>


      <Tab.Content>
        <Tab.Pane eventKey="first">
          {/*< name /> */}
        </Tab.Pane>
        <Tab.Pane eventKey="second">
           {/*< name /> */}
        </Tab.Pane>
      </Tab.Content>

  </Row>
</Tab.Container>
    </div>
    <div className="details-info">

    <div className="PuppyPageLayout">
      <Row>
              Hello, My name is {puppy.name}

            I was born: {puppy.dob}


            My color right now is: {puppy.color}
            </Row>

            I come with an option of: {puppy.reg}


            Show Potiential? : {puppy.potiential}

            I am a:  {puppy.gender}



            Status:      {puppy.status == "Available" ? 
           <div className="blinking" id="Available"> { puppy.status} </div>
            :
            <div className="blinking" id="Sold"> { puppy.status} </div>
        }


            {puppy.status == "Available" ? 
            <button onClick={handleAddtoDeposit} className="button">
                Purchase Options
            </button>
            :
            <div className="li"> Sorry, Found My Family </div>
        }
       </div>
    </div>
    </div>
    )
    }
    </div>
    </div>
    </div>
    </div>
}
export default PuppyPage;
